	(166,1,3,'','<p>Светлый праздник Рождества это тепло в наших сердцах, подобно пламени свечи озаряющее сумерки холодного зимнего вечера. Рождественская свеча в исполнении нашего флориста - это зимняя настольная композиция, эмоциональная и трогательная, свежая как запах еловых елей и теплая, как материнский поцелуй.</p>\n<p></p>\n<p>Композиция собрана вручную из натуральных растений.</p>','rozhdestvenskaya-svecha','Купить новогодний букет в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Заказать Новогодний букет Кишинев Молдова','Рождественская Свеча','','','',''),
