	(169,1,2,'','','aroma-de-craciun-','Comandă cadou de Crăciun cu mandarine online în magazinul cadouri.md ✓ Livrare pe tot teritoriul Moldovei ✓ Buchete personalizate ✓ Cadouri originale ✓ Livrare gratuită în Chișinău  ➨ Vezi pe site!','','Comandă Cadou de Crăciun cu mandarine Chișinău Moldova','Aroma de Crăciun','','','',''),
	(169,1,3,'','<p>Что еще так ярко ассоциируется у нас с зимней порой, как не свежий запах цитрусовых? Стоит услышать знакомые ароматные нотки и вот, глаза уже загораются детской радостью! Самые вкусные мандарины можно найти только зимой, когда рождественские эльфы-эксперты собирают их для наших фруктовых корзин.</p>\n<p></p>\n<p>В состав гифт бокса входит:</p>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Очень много вкусных мандаринок </li>\n<li>Красивая корзинка (можно использовать повторно для чего-нибудь)</li>\n<li>Большая детская радость (1 шт.)</li>\n<li>Декор из натуральных растений</li>\n</ul><p></p>\n<p><strong>Пожалуйста, обратите внимание, что мы не производим пищевые продукты сами, только красиво упаковываем в день отправления, на радость получателям. </strong></p>','zapakh-rozhdestva','Купить новогодний подарок с мандаринами в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Заказать Новогодний подарок с мандаринами Кишинев Молдова','Запах Рождества','','','',''),
