	(171,1,3,'','<p>Рождество уже близко! Как много красоты и тепла в этом светлом празднике! По такому случаю мы создали невероятной красоты гифт бокс, наполненный духом Рождества!</p>\n<p>В состав гифт бокса входит:</p>\n<ul><li>Натураньный цветочный мёд Sweet Honey с инжиром</li>\n<li>Мёд суфле Sweet Honey (Шоколадная медовая паста с фундуком. Натуральный продукт. Без добавления сахара и красителей. Состав: цветочный мед, растертые какао-бобы и фундук.)</li>\n<li>Апельсиновый бельгийский шоколад со специями, обжаренным бланшированным фундуком и клубникой</li>\n<li>Кусочек праздничного настроения (100 гр)</li>\n</ul><p></p>\n<p><strong>Пожалуйста, обратите внимание, что мы не производим никакие пищевые продукты сами, хотя нам очень этого хотелось бы. Зато мы очень красиво собираем их в крутые подарки в день заказа.</strong></p>','dukh-rozhdestva','Купить рождественский подарок с медом в интернет магазине cadouri.md. ✓ Доставка по всей Молдове ✓ Авторские букеты ✓ Оригинальные подарки ✓ Бесплатная доставка по Кишиневу  ➨ Смотрите!','','Заказать Рождественский подарок с медом Кишинев Молдова','Дух Рождества','','','',''),
