	(10,1,'How to choose a perfect gift for a Scorpio? What flowers are suitable by Astrology? View more...','','Astrology Gift Giving: What to give to a Scorpio?','astrology-gift-giving-what-to-give-to-a-scorpio','<p>Girls Scorpios are very capricious. For them it is important not just your attention, but also the gift itself, and they are not afraid to admit this to themselves. Girls Scorpios are able to show attention with their gifts, and they expect this from others as well.</p>\n<p></p>\n<p>Women Scorpios do not perceive flowers as a full-fledged gift. This is a great sign of attention, worthy of joy and pleasant memories, but no more. The thing is that Scorpios love individual approach.</p>\n<p></p>\n<h2>If you want to choose flowers for a girl Scorpio:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Be sure to find out what are her favorite flowers, it’s important if you show extra attention to Scorpions and show that you remember her preferences.</li>\n<li>Look at simple and concise bouquets without additional decoration, regardless of whether the field flowers or elegant roses</li>\n<li>Do not forget that only a bouquet of fresh flowers makes a good impression, because they will stay longer and look neater</li>\n<li>Look for bouquets and flower arrangements of peonies, garden roses, pink carnations or eustome. Despite its controversial character, the girls of Scorpio are delighted with delicate flowers.</li>\n<li>If you choose a gift for a woman Scorpio, be creative, think of her innermost dreams. Scorpios love gifts that are made specifically for them, which means they have something hinting at their identity. However, we do not always have the opportunity to think for too long.</li>\n</ul><p></p>\n<h2>A perfect gift can be:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>The diary or an interesting notebook with a set for creativity</li>\n<li>Gift box with a variety of sweets</li>\n<li>Big set with personal care products</li>\n<li>Wine set for a romantic evening for two, if you happen to be in a relationship with a girl Scorpio</li>\n</ul><p></p>\n<p>You can at contact us with a question about gifts or flowers and we will select something unusual for your particular occasion.</p>\n<p> </p>','',''),
	(10,2,'','','Flori și cadouri pentru Scorpion. Cum să alegi cadouri pentru cei născuți în Noiembrie?','flori-i-cadouri-pentru-scorpion-cum-sa-alegi-cadouri-pentru-cei-nascui-in-noiembrie','<p>Fetele Scorpioni sunt persoane cu un caracter foarte puternic.  Le este importantă nu doar atenția din partea Dvs., dar și cadoul primit. Domnișoarele Scorpioni știu cum să facă cadouri personalizate și așteaptă că veți fi la fel de atenți la detalii pentru ele.</p>\n<p></p>\n<p>Femeile Scorpioni nu cred că florile pot fi ceva mai mult, decât un semn de atenție, chiar dacă este frumos, proaspăt și va aduce emoții pozitive. Deaceea în adâncimea sufletului mereu așteaptă ceva în plus (cât de micuț n-ar fi cadou.) Fetele Scorpioni vă vor mulțumi pentru un cadou personalizat.</p>\n<p></p>\n<h2>Dacă vreți să alegeți florile pentru o femeie Scorpion:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Aflați neapărat ce fel de flori preferă mai mult. Pentru domnișoarele Scorpioni este foarte important că le țineți minte preferințele.</li>\n<li>Atrageți atenția la buchete mai simple, fără decor exagerat, indiferent dacă sunt flori de grădină sau trandafiri elegante.</li>\n<li>Nu uitați că impresia cea mai bună fac flori proaspete, deoarece vor sta în apă mai mult timp și au un aspect mai curat și îngrijit.</li>\n<li>Alegeți dintre compoziții floristice cu trandafiri de grădină, bujori, garoafe roz sau eustome. În ciuda faptului că Scorpionii au un caracter complicat, preferă flori palide la culoare și gingașe.</li>\n<li>Dacă sunteți în căutare de cadou pentru femeie Scorpion, încercați să fiți creativi.Amintiți la ce visează femeia Scorpion. Un cadou făcut de mâni și personalizat, un cadou la care demult visau sau despre care au povestit mult, ceva legat cu copilăria lor sau cu emoții pozitive puternice - se va potrivi orice din lista propusă. Dar, uneori nu avem prea mult timp pentru a căuta ceva special.</li>\n</ul><p></p>\n<h2>Un cadou perfect va deveni:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Set pentru creație cu un sketchbook sau carnet</li>\n<li>Gift Box cu un set mare de dulciuri</li>\n<li>Un set mare SPA cu diferite produse pentru îngrijirea pielii</li>\n<li>Un Gift Box cu vin pentru doi (În caz dacă aveți fericirea să fiți în relații cu Scorpion)</li>\n</ul><p></p>\n<p>În orice caz puteți apela la ajutorul nostru în alegerea cadourilor. Cu noi a deveni mai simplu să fii creativ în alegerea cadourilor!</p>\n<p> </p>','',''),
	(10,3,'Как подобрать подарок девушке Скорпиону? Как выбрать цветы, которые подходят по гороскопу? Подробнее...','','Какие цветы дарить Скорпионам? Флористический прогноз.','kakie-cvety-darit-skorpionam-floristicheskij-prognoz','<p>Девушки Скорпионы - очень своенравные, характерные личности. Для них важно не только внимание, но и сам подарок, и они не боятся себе в этом признаться. Девушки Скорпионы умеют сами проявлять внимание и тщательно продумывают свои подарки, а потому ждут этого и от окружающих.</p>\n<p></p>\n<p>Женщины Скорпионы не воспринимают цветы как полноценный подарок. Для них это прекрасный знак внимания, достойный радости и приятных воспоминаний, но не более. А все дело в том, что Скорпионы любят индивидуальный подход.</p>\n<p></p>\n<h2>Если Вы хотите выбрать цветы для девушки Скорпиона:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Обязательно узнайте, какие цветы у нее любимые, для Скорпионов важно, если вы проявите дополнительное внимание и покажете, что помните ее предпочтения</li>\n<li>Присмотритесь к простым и лаконичным букетам без дополнительного декора вне зависимости от того, полевые это цветы или элегантные розы</li>\n<li>Не забывайте о том, что хорошее впечатление производит только букет из свежих цветов, потому что они дольше простоят и выглядят аккуратнее</li>\n<li>Поищите букеты и цветочные композиции из пионов, садовых роз, розовых гвоздик или эустом. Несмотря на свой противоречивый характер, девушки Скорпионы в восторге от нежных цветов.</li>\n<li>Если Вы выбираете подарок для женщины Скорпиона, проявите творческий подход, вспомните о ее сокровенных мечтах. Скорпионы обожают подарки, которые сделаны специально для них, а значит в них есть нечто, намекающее на их личность. Тем не менее у нас не всегда есть возможность думать слишком долго.</li>\n</ul><p></p>\n<h2>Отличным подарком может стать:</h2>\n<p></p>\n<ul style=\"list-style-type:circle;\"><li>Ежедневник или интересный блокнот с набором для творчества</li>\n<li>Гифт бокс с разнообразными сладостями</li>\n<li>Большой набор со средствами по уходу за собой</li>\n<li>Винный набор для романтичного вечера на двоих, если вам посчастливилось быть в отношениях с девушкой Скорпионом</li>\n</ul><p></p>\n<p>Вы можете в любой момент обратиться к нам с вопросом о подарках или цветах и мы подберем что-то необычное конкретно для Вашего случая. С нами делать оригинальные подарки любимым и дорогим людям стало легче!</p>\n<p> </p>','','');
